\begin{verbatim}
Dataset2412
\end{verbatim}
A struct containing UFF Dataset 2412 metadata.

\textbf{Fields}

\begin{itemize}
\item \texttt{type::Symbol}: Data set type


\item \texttt{elements\_ID::Vector\{Int\}}: Element label


\item \texttt{fe\_descriptor\_id::Vector\{Int\}}: Finite element descriptor ID


\item \texttt{phys\_property::Vector\{Int\}}: Physical property table number


\item \texttt{mat\_property::Vector\{Int\}}: Material property table number


\item \texttt{color::Vector\{Int\}}: Color


\item \texttt{nodes\_per\_elt::Vector\{Int\}}: Number of nodes per element


\item \texttt{connectivity::Vector\{Vector\{Int\}\}}: Element connectivity (node labels)


\item \texttt{beam\_info::Vector\{Vector\{Int\}\}}: Beam element information

\end{itemize}
